import React from 'react';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import './App.css';
import {LoginComponent} from './Components/loginPage.js';


function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>

      {/* Components are imported and used here */}
      <Router>
        <Routes>
          <Route path="/loginPage" element={<LoginComponent />} />
        </Routes>
      </Router>

    </div>
  );
}

export default App;
